A:

Found the issue.
In <code>stdiomodule.c</code> I initially had this code:
<code>static PyObject *py_print = NULL;

static void
_stderr_write(const char *msg)
{
    fputs(msg, stderr);
}

static PyObject *
stdio_stderr_write(PyObject *self, PyObject *msg)
{
    PyObject *msg_str, *FAIL;
    Py_INCREF(msg);
    if (!PyUnicode_CheckExact(msg)) {
        PyUnicode_Type.tp_call((PyObject *)&amp;PyUnicode_Type,
                               (PyObject *)NULL, NULL); /* raise TypeError */
        return NULL;
    }
    msg_str = PyUnicode_AsEncodedString(msg, "utf-8", "strict");
    if (!msg_str)
        return NULL;
    fputs(PyBytes_AS_STRING(msg_str), stderr);
    Py_DECREF(msg_str);
    Py_DECREF(msg);
    Py_INCREF(Py_None);
    return Py_None;
}
</code>
But since you said to use <code>Py_BuildValueAnother</code>, I modified it to look like this instead:
<code>static PyObject *py_print = NULL;

static PyObject *
stdio_stderr_write(PyObject *self, PyObject *args)
{
    PyObject *msg;
    if (!PyArg_ParseTuple(args, "O", &amp;msg)) {
        return NULL;
    }
    Py_INCREF(msg);
    fputs(PyBytes_AS_STRING(msg), stderr);
    Py_DECREF(msg);
    Py_RETURN_NONE;
}

static PyMethodDef stdio_methods[] = {
    {"stderr_write", stdio_stderr_write, METH_VARARGS, NULL},
    {NULL, NULL, 0, NULL}
};
</code>
Now it seems to work!
